import { request } from "./request.js";

export const saveservice = async (name, annotation, cost, idtype, idsupertype) => {

  const formData = {"name": email, "name": annotation, "telegram": cost, "code": idtype, "": idsupertype};
  const path = '/api/singup';

  return request(path, formData)

};
